'use strict';

// MODULES //

var copy = require( '@stdlib/utils/copy' );
var data = require( './../data/data.json' );


// MAIN //

/**
* Returns wage rates of U.S. workers that have not changed jobs within the year.
*
* @returns {ObjectArray} data
*
* @example
* var data = wages();
* // returns [{...},{...},...]
*/
function wages() {
	return copy( data );
}


// EXPORTS //

module.exports = wages;
